import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App" >
      <fieldset>
        <form>
          <h1>Form Pembelian Buah</h1>

          <label for="nama">Nama Pelanggan</label>
          <input type="text" id="nama"></input>
          <br></br>
          <label for="">Daftar Item</label>
          <input type="checkbox" id="daftaritem"><label>Semangka</label></input>
          <input type="checkbox" id="daftaritem"><label>Jeruk</label></input>
          <input type="checkbox" id="daftaritem"><label>Nanas</label></input>
          <input type="checkbox" id="daftaritem"><label>Salak</label></input>
          <input type="checkbox" id="daftaritem"><label>Anggur</label></input>

          <br></br>
        </form>
      </fieldset>
    </div>
  );
}

export default App;
